@Override
public boolean equals(Object o) {
  if (this == o) return true;
  if (o == null || getClass() != o.getClass()) return false;

  ShardDoc shardDoc = (ShardDoc) o;

  if (id != null ? !id.equals(shardDoc.id) : shardDoc.id != null) return false;

  return true;
}

